import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Home from './components/Home';
import PieChart from './components/PieChart'; // Ensure correct path

const App = () => {
  return (
    <Router>
      <Switch>
        <Route path="/" exact component={Home} />
        <Route path="/PieChart" component={PieChart} /> {/* Ensure this route matches your link */}
        {/* Add other routes as needed */}
      </Switch>
    </Router>
  );
};

export default App;
